"use client"
import { Box, Flex, VStack } from "@chakra-ui/react"
import "cropperjs/dist/cropper.css"
import { useCallback, useEffect, useRef, useState } from "react"



export function RotateWheel({ rotation, onRotate }: { rotation: number, onRotate: (rot: number) => void }) {



    const [startX, setStartX] = useState(0);
    const [startRotate, setStartRotate] = useState(0);
    const [active, setActive] = useState<boolean>(false)
    const [rotate, setRotate] = useState<number>(rotation);

    useEffect(() => {
        setRotate(rotation)
    }, [rotation])

    const mousemoveCallback = useCallback((ev: MouseEvent) => {
        if (!active) return;

        const dX = ev.screenX - startX
        let rot = Math.round(startRotate + (dX / 6))
        if (rot > 180) {
            setStartX(ev.screenX);
            setStartRotate(180);
            rot = 180;
        }
        if (rot < -180) {
            setStartX(ev.screenX);
            setStartRotate(-180);
            rot = -180;
        }

        setRotate(rot)
        onRotate(rot)
    }, [startX, startRotate, active])

    const mouseDownCallback = useCallback((ev: React.MouseEvent<HTMLDivElement, MouseEvent>) => {
        setStartX(ev.screenX);
        setStartRotate(rotate);
        setActive(true);
    }, [rotate])


    const mouseUpCallback = useCallback(() => {
        setActive(false)
    }, [active])

    useEffect(() => {
        window.addEventListener("mousemove", mousemoveCallback)
        window.addEventListener("mouseup", mouseUpCallback)
        return () => {
            window.removeEventListener("mousemove", mousemoveCallback)
            window.removeEventListener("mouseup", mouseUpCallback)
        }
    }, [active])
    const divRef = useRef<HTMLDivElement>(null)




    return <VStack w="100%">

        <Box w="6px" h="6px" borderRadius="50%" backgroundColor={"gray.500"}></Box>
        <Flex justifyContent={"center"} onMouseDown={mouseDownCallback}
            h="70px" overflow={"hidden"} w="100%">

            <div ref={divRef} style={{ width: "1606px", height: "1606px", transformOrigin: "803px 803px", transform: `rotate(${rotate}deg)` }}><Wheel></Wheel></div>

        </Flex>



    </VStack>
}
